import React from 'react';

export const EmployeesDashboard = ({ onFormSwitch }) => {
    return (
        <div>
            <h1>Employees Dashboard</h1>
            <button onClick={() => onFormSwitch('login')}>Logout</button>
        </div>
    );
};
